        });
        gd.on('plotly_unhover', function(data) {
            gd.querySelectorAll('.legendtext').forEach(function(item) {
                item.style.fontWeight = 'normal';
            });
            Plotly.restyle(gd, { 'line.width': 2 }, Array.from({ length: gd.data.length }, (_,i) => i));
        });
    });
})();
</script>
</body>
</html>
